  <script nonce="">function initQRCodePoll() {
  const qrCodeAuth = document.querySelector('#qr-code-auth');
  if (!qrCodeAuth) {
    console.error('Failed to find login form for passcode polling');
    return;
  }

  const tokenData = qrCodeAuth.dataset.token;
  if (!tokenData) {
    console.error('Failed to find token for passcode polling');
    return;
  }

  const csrf = qrCodeAuth.dataset.csrf;
  if (!csrf) {
    console.error('Failed to find csrf token for passcode polling');
    return;
  }

  const startQrPolling = (token, csrf, attempt = 1) => {
    // ~10 minutes
    if (attempt > 150) {
      // TODO(margret): fade-out qr code and replace with instructions
      //   to refresh the page for a new qr code
      return;
    }

    setTimeout(() => {
      fetch('/login/qr_remote', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'X-CSRF-TOKEN': csrf
        },
        body: JSON.stringify({ n: token })
      })
        .then(r => r.text())
        .then((r) => {
          if (r == "OK" || r == "Invalid session") {
            window.location.href = '/';
            return;
          }

          startQrPolling(token, csrf, attempt + 1);
        }).catch(console.error);

    }, 4000);
  };

  startQrPolling(tokenData, csrf);
}

initQRCodePoll();
</script>
